        "description": "Nominees were accepted. Candidates were discussed. A Rock Star was chosen.\r\nThe 2015 Rock Star for a Day is Dani \u201cRat Lady\u201d Moore!\r\n\r\nDani Moore has been the ring leader and endless spokesperson for Mobility Camp. Dani has helped spread word and expand knowledge about Mobility Camp\u2019s goals and mission to build awareness and improved alternative abled access at Burning Man.\r\n\r\nDani is an incredible, living example of Burning Man\u2019s radical inclusion principle. She is an inspiration and crates a lasting impact on our culture, maternally calling for inclusive accessibility and consciousness by us all.\r\n\r\nHelp us celebrate by participating in her Rock Star day with her! \r\n\r\nYou can't make the event? \r\n\r\n* Search your local craigslist for Dani's Wish List items and drop them by Mobility Camp at Center Camp:\r\n\r\n-- A gas powered golf cart with hand controls: to borrow for Burn or to own\r\n-- Knee Scooters\r\n-- Wheelchairs *with foot rests* all sizes, in particular XL/Bariatric\r\n-- Crutches of all sizes; most needed size 4\u20196\u201d-5\u20192\u201d & 5\u20191\u201d-5\u20199\u201d\r\n-- Walkers of all sizes\r\n-- Handcycles to borrow for Burn\r\n-- Photographer to capture Mobility Camp activities \r\n\r\nDani will receive playa rock star treatment Thursday afternoon, including transportation and soulful beats via her \"limo\" the Charlie the Unicorn art car (Yay, thank you Unicorn Crew!) Come join in on the fun anytime! \r\n\r\nRadically Inclusive! Join Us! Everyone's welcome to hug the rock star, jump into the limo and participate! \r\n\r\n12:00pm Arrive at Mobility Camp, Center Camp \r\nInner ring/6:00\r\nPresent Dani Moore with her Rock Star status.\r\n1:00pm All participate in the accessibility obstacle course\r\n1:45pm Transport Dani and anyone else to Kostume Kult\r\nfor rock star outfitting 6:45 & Esplanade\r\n2:45pm Limo departs for an out on open playa adventure \r\nto be announced\r\n3:00pm Special thank you surprise.\r\n3:45pm Rock Star Charlie the Unicorn limo returns Dani \r\nand everyone else to Mobility Camp!",
