        "description": "Home Sweet Dome presents the Church of the 5th Element theme camp at 7:30 and Carny.\r\n\r\nJoin us all week for a variety of interactive events, including sunset cocktails, popcorn, chill house beats, an open bouldering wall, workshops, and nightly lighting of our 8 ft. in diameter steel globe fire pit.\r\n\r\nThe ELEMENTS\r\n\r\nFIRE: we'll blaze up our 8 ft.-in-diameter steel globe fire pit so you can watch the world burn before you burn baby burn! Popcorn included.\r\n\r\nEARTH: monkey around on our rock climbing wall \r\n\r\nWATER: home-crafted, artisan libations and cold brew\r\n\r\nWIND: Home Sweet Dome resident DJ beats in the air\r\n\r\nThe FIFTH ELEMENT: That's you of course, bringing all the love. \u2665 \r\n\r\nSCHEDULE OF EVENTS\r\n\r\nMonday 8/31\t: \r\nWorkshop: The basics of healing and energy work at 1 pm\r\n7:30 Sector Neighborhood Welcome Party at 5 pm\r\n\r\nTuesday 9/01:\r\nMorning Cold Brew at 10 am\r\nWorkshop: Lucid Dreaming at 2 pm\r\nSunset cocktails and Watch the World Burn Firepit at 5 pm \r\nBouldering , all day\r\n\r\nWednesday 9/02\r\nSunset cocktails and Watch the World Burn Firepit at 5 pm \r\nBouldering , all day\r\n\r\nThursday, 9/03\r\nSunset cocktails and Watch the World Burn Firepit at 5 pm \r\nWorkshop: Fireside yoga with Risha at dusk \r\nBouldering , all day\r\n\r\nFriday, 9/04\r\nHome Sweet Dome Salon with musical performance by Eitch, meditation, story talk and chanting. Sunset.\r\nBouldering, all day",
