        "title": "Life Coaching",
        "uid": "hV7cbeXxauwAayDVVUXK",
        "description": "IMAGINEnation is a camp dedicated to the power of dreaming and radical honesty.\r\nOur coaches provide daily life coaching workshops and one-on-one coaching to the people of the playa. We are offering 30 minute sessions, Monday thru Saturday 12-4pm to help you sort out your life.\r\nWhether it's finding a job you love, fixing your relationship, losing 30 pounds or simply being ready for the next exciting chapter in life, the work you will do with your coach will provide immediate inspiration, serious results and lasting knowledge.\r\n\r\nOur Life Coaches have been through a rigorous training process and utilize The Handel Method, which is also the foundation of the work we teach at MIT, NYU and Stanford.\r\n\r\nTogether we dig deep, play big and don\u2019t stop until goals are fulfilled and lessons learned. We care, we love what we do and we walk our talk.",
