        "title": "Naked Oil Wrestling",
        "uid": "WWNHdQy7ZuUBZ4o727Sh",
        "description": "Wrestling is one of the most fun sports you can ever try. It\u2019s also one of humanity\u2019s oldest and was among the major events of the original Olympics. Long before we were kicking balls around we were rolling around in the dirt, putting each other in headlocks! It doesn\u2019t matter if you\u2019re a complete novice who\u2019s never tried it in your life or an experienced fighter, come along and experience this amazing bonding experience in Gymnasium, Black Rock City\u2019s Ancient Greek wrestling school (7:30 Portal).\r\n\r\nWe will start warming up and a workshop on wrestling basics at 10:30. This will be followed by competitions starting at 11:30. Participants will be provided showers at another camp.",
