        "description": "Let the shade and soft music melt away the stresses of the week. We will move us through a relaxation exercise to help us gain ultimate relaxation. \r\nExperiencing this exercise in your birthday suit is amazing but we do understand that not everyone is comfortable that way. You will not be turned away for wearing clothing to class!\r\nPrize wheel spin off after class!\r\n\r\nAs you enter the schoolhouse, make sure to stop and get a class time snack \t\r\nand some refreshing H2O to fuel your mind and body. \r\nEach attendee will also receive a souvenir that will be used to help us randomly pick lucky class attendees to spin the prize wheel. Each lucky spinner is guaranteed a great prize! Class participation is strongly encouraged. The School is a judgment free zone where everybody is welcome!",
