        "uid": "cfsqUwi4kTXx7o9bUZjb",
        "description": "Have you ever encountered yourself, as if for the first time? Emerged from a maze to discover that really, nothing is as it seems? \r\n\r\nEach of us has a main stem of how we interpret our life story -- family, location, school, work, and religion are often included in this story -- this circle is about the moments when get a glimpse of some part of what that stem looks like, discovering ourselves through an encounter with another. \r\n\r\nParticipants can think of a story before coming, and we'll also have a moment of reflection at the beginning, to help spark good stories, filled with the moments that make up great stories.",
