        "description": "Saturday, Day of the Burn, 5:30 - 7:00 PM\r\n\r\nIn Black Rock City there is much to see, always, in the way of art-- buildings and structures, Art Cars and installations... but there's another kind of art to see, as it strolls around the Playa...\r\nIt's the often unique way each of us dress (or undress) for the event!\r\nAnd each year, there's one gathering place where Playa Fashions shine their brightest.\r\nThat's the Big Stage in Center Camp Caf\u00e9. The day is Saturday, and the time right before the Burn, starting around 5:30 PM.\r\nThe PEOPLE'S FASHION SHOW, a tradition since 1987, is the place to see and be seen, as the amazing creations worn on the Playa have their moment before our audience on our Runway.\r\nJoin your hosts, Dr. Howland Owll and DJ Justin Credible, as we present this year's highlights of YOUR Incendiary Couture!\r\nFantastic outfits, puppets, body decoration or just one's signature Playa clothing-- anything and anyone may appear. Models assemble backstage.\r\nCome and watch... or even better, be a part of it!",
