        "uid": "P8a73fGsv5xzQNrCuNvu",
        "description": "There is power in making a choice to be present. To witness. To be witnessed. A choice to see and be seen as we are and in our highest self\r\n\r\nWhen we gather with intention, we gather and increase in said powers. This will be such a gathering...\r\n\r\n...and in such times and at such gatherings true magic, transformation, renewal and clarity through spaciousness are even more possible, even more accessible, for that tribal heart intention is an almost irresistible force for ourselves individually and collectively. \r\n\r\nThis heart centered gathering is a simple but profound Puja (Devotional) ceremony of seeing and being seen first in silence, then with witnessing, listening and sharing, so that we may open to the possibility of falling in love with ourselves either directly or through the eyes of another. \r\n\r\nI invite you to be vulnerable. To see and be seen in this moment. To open to the beautiful reflections in each other. \r\n\r\nCome to this gathering because you are READY to step up into your full expression. Ready to be the Strong Man and a Powerful Woman who has the right to be met, and the right to love and be loved.",
